import React from 'react';
// import logo from './logo.svg';
import{
  BrowserRouter as Router,
  Switch,
  Route,
  Link
}from "react-router-dom"
import './App.css';

import ArticleListing from './pages/ArticleListing';
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path = "/">
            <ArticleListing/>
          </Route>
          <Route path = "article/:id">
            <Article />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
